  constructor(){
    super(this);
    this.state = {
      "array":[
        {
          id: 1,
          name :"don dep"
        },
        {
          id: 1,
          name :"don dep"
        },
        {
          id: 1,
          name :"don dep"
        }
      ]
    }
  }
  render() {

    let element = this.state.array.map((item,index)=>{
      return <TasksList 
      key={index}
      name= {item.name}
      content="task 1 content"
    />
    })
    return (
      <div>
        <Header />
        <div className="row">
            <div className="col-6">
                {element}
            </div>  
        </div>
        <button type="button" className="btn btn-primary"
        onClick={this.onClick}
        >

        click me</button> 

        <button type="button" className="btn btn-primary"
        onClick={this.onClick2('abc')}
        >
        click me 2
        </button>  
      </div>

    );
  }
  onClick2 = ()=>{
    console.log(this.refs);
  }
  onClick(){
    console.log('clicked');
  }
}

export default App;
